const currencyLoaded = (currency, v) => {
	return {
		type: 'CURRENCY_LOADED',
		payload: currency,
		payload2: v
	};
};

const convertibleCurrency = (code, value, v) => {
	return {
		type: 'CONVERTIBLE_CURRENCY',
		code,
		value,
		payload2: v
	};
}

const newVal = (v) => {
	return {
		type: 'VAL_2',
		payload: v
	};
}

export {
	currencyLoaded,
	convertibleCurrency,
	newVal
};
